import React, {useState, useEffect} from 'react';
import Header from "./Header";
import youtube from '../apis/youtube';
import {Grid, 
        Card,
        CardHeader,
        CardContent,
        CardActions,
        CardMedia,
        makeStyles,
        Typography
    } from '@material-ui/core';

const useStyles = makeStyles((theme) =>({
    toolbar: theme.mixins.toolbar,
    card:{
        minWidth: 275,
    },
    media: {
    height: 0,
    paddingTop: '56.25%', // 16:9
  },
 }));
export default function OtherVideos(){
    const [data,setData] = useState();
    useEffect(()=>{
        async function getOtherVids(){
            let response = await youtube.get('search', {params:{
            q:'-COVID -19 -Vaccine -Podcast',
           }});
           let responseData = await response.json();
           console.log("OTHER DATA", responseData);
           setData(responseData);
        }
    });
    const classes  = useStyles();
    return(

         <div className="container">
            <Header />
            {/*Create space between grid & app bar*/}
            <div className={classes.toolbar}></div>
                <Grid container 
                  direction="column"
                  spacing={3}
                  justifyContent='center'
                  alignItems='center'
            >
                <Grid item xs={12} sm={6}>
                    <Card className={classes.card}>
                        <CardHeader>
                            <Typography variant="h6">Some Header</Typography>
                        </CardHeader>
                        <CardContent>
                            <Typography variant="body1">Some Body</Typography>
                        </CardContent>
                    </Card>
                </Grid>
                <Grid item xs={12} sm={6}>
                    <Card className={classes.card}>
                        <CardHeader>
                            <Typography variant="h6">Some Header</Typography>
                        </CardHeader>
                        <CardContent>
                            <Typography variant="body1">Some Body</Typography>
                        </CardContent>
                    </Card>
                </Grid>

            </Grid>
        </div>
    );
}
